<?phpnamespace Nemundo\App\Scheduler\Script;use Nemundo\App\Scheduler\Application\SchedulerApplication;use Nemundo\App\Scheduler\Data\Scheduler\SchedulerReader;use Nemundo\App\Script\Type\AbstractConsoleScript;use Nemundo\Com\TableBuilder\TableRow;use Nemundo\Core\Debug\Debug;class SchedulerListScript extends AbstractConsoleScript{    protected function loadScript()    {        $this->scriptName = 'scheduler-list';    }    public function run()    {        (new Debug())->write('Active Scheduler Jobs:');        $schedulerReader = new SchedulerReader();        $schedulerReader->model->loadScript();        $schedulerReader->model->script->loadApplication();            $schedulerReader->filter->andEqual($schedulerReader->model->active,true);        foreach ($schedulerReader->getData() as $schedulerRow) {            (new Debug())->write($schedulerRow->script->scriptName);        }    }}